import React from "react";
import styled from "styled-components";

const Btn = styled.button`
  padding: 8px 16px;
  background-color: #f38c29;
  color: #142610;
  border: none;
  cursor: pointer;
  padding: 15px;
  border-radius: 50px;
`;

const Button = () => {
  const handleShowAllVeggies = () => {
    // Navigera till "show all veggies"-sidan
    window.location.href = "/show-all-veggies";
  };

  const handleFavorites = () => {
    // Navigera till "favorites"-sidan
    window.location.href = "/favorites";
  };

  return (
    <div>
      <Btn onClick={handleShowAllVeggies}>Show all Veggies</Btn>
      <Btn onClick={handleFavorites}>Favorites</Btn>
    </div>
  );
};

export default Button;
